function TechStack() {
    return(
        <>
            <ul style={{listStyle: 'none', display: 'flex', justifyContent: 'center', gap: '10px' }}>
                <li>HTML</li>
                <li>CSS</li>
                <li>JAVASCRIPT</li>
                <li>REACT JS</li>
            </ul>
        </>

    )
}

export default TechStack;
